import React, { Component } from 'react';

class Main extends Component {
  render() {
    const {userSearched} = this.props;



    return (
      <main>
        {
          userSearched.map(user => (
            <h1>{user.login}</h1>
          ))
        }
      </main>
    );
  }
}

export default Main;
